	    'training.section1.point1.desc': 'Barn pekar och vill ha. Genom att betala t barnen fr de inte en uppfattning om var pengar kommer ifrn eller vad som krvs fr att spara ihop till ngot vrdefullt Se till att diskutera vad dina barn ska f och vad de ska betala fr sjlva. Det r frst nr det finns en id om hur pengar kan anvndas som de fr ett riktigt vrde.',
