	    'training.section1.point2.desc': 'Anvnd ett betalkort eller pengar i telefonen. D lr sig barnen om digitala pengar och att de ofta frekommer som siffror p en skrm. Det r s pengar kommer att anvndas i framtiden och drfr ett bra stt att frbereda sina barn fr vuxenlivet.',
	    'training.section1.point3.title': 'Brja tidigt!',
	    'training.section1.point3.desc': 'I tidig lder r det som lttast att lra ut ett bra frhllningsstt till pengar. Men du kan lika grna anvnda en annan belning n just pengar, det kan vara lrdagsgodis i utbyte mot en veckas ordentlig tandborstning. Frsk att belna positiva beteenden, de r dem du vill se mer av!',
	    'training.tab1.title': 'Ekonomiskt trning',
	    'training.tab1.header': 'Det handlar inte om mngden pengar, utan om frhllandet till dem.',
	    'training.tab1.content': "\n        <p>\n            <b>Introducera och agera bollplank</b>\n            <br/>\n            De flesta barn f\xE5r sin f\xF6rsta veckopeng mellan 7-10 \xE5r och d\xE5 uppg\xE5r den oftast till\n            20 kr. I\n            takt med att barnet mognar och blir \xE4ldre kan du \xF6ka veckopengen och slutligen\n            ansvaret genom\n            att g\xE5 \xF6ver till m\xE5nadspeng. T\xE4nk p\xE5 att du inte bara ska ge ut pengar, utan snarare\n            diskutera\n            med ditt barn om de \xE4r n\xF6jda med sina val och hur de har valt att anv\xE4nda sina\n            pengar.\n        </p>\n        <p>\n            <strong>Middagsbordet \xE4r inte fel</strong>\n            <br/>\n            Att prata om pengar vid middagsbordet \xE4r inte fel. Pengar ska vara kul och inte\n            \xE5ngestdrabbat\n            eller p\xE5 tals d\xE5 de \xE4r slut eller barnet vill k\xF6pa n\xE5got. M\xE5nga gr\xE4l mellan\n            f\xF6r\xE4ldrar och barn\n            handlar just om pengar, d\xE4rf\xF6r ska man prata om det ofta och inte bara n\xE4r det\n            kniper i\n            pl\xE5nboken. Ett bra tillf\xE4lle \xE4r d\xE5 du ger ut vecko- eller m\xE5nadspengarna till\n            barnet.\n        </p>\n        <p>\n            <strong>F\xF6rhandla med dina barn\n                <br/>\n            </strong>\n            F\xF6rhandla med ditt barn om vad pengarna ska r\xE4cka till och kom \xF6verens. En lagom\n            niv\xE5 p\xE5\n            veckopengen \xE4r d\xE5 de har r\xE5d att k\xF6pa det som de beh\xF6ver och samtidigt ha lite\n            pengar kvar till\n            att spara. Om ditt barn s\xE4ger att andra har mer i veckopeng kan du f\xF6rklara varf\xF6r\n            de har\n            mindre, det \xE4r viktigt att du f\xF6rklarar att alla m\xE4nniskor inte har lika mycket\n            pengar.\n        </p>\n        <p>\n            <b>S\xE4g nej n\xE4r pengarna \xE4r slut</b>\n            <br/>\n            Genom att vara \xF6verens om en vecko- eller m\xE5nadspeng kan dina barn sj\xE4lva ta ansvar\n            f\xF6r vad de\n            vill handla eller spara till. De kan p\xE5 s\xE5 s\xE4tt v\xE4nta sig att f\xE5 pengar vid vissa\n            tillf\xE4llen och\n            p\xE5 s\xE5 s\xE4tt disponera sina pengar och ta ansvar f\xF6r vad de vill k\xF6pa. Och om pengarna\n            \xE4r slut, ja\n            d\xE5 \xE4r de slut och barnet f\xE5r v\xE4nta till n\xE4sta veckopeng.\n        </p>\n        <p>\n            <strong>L\xE5t dina barn k\xF6pa fel saker</strong>\n            <br/>\n            Sm\xE5 barn k\xF6per godis f\xF6r den st\xF6rsta delen av sina veckopengar. F\xF6r pojkar \xE4r TV-\n            och dataspel\n            mer vanligt och f\xF6r tjejer \xE4r det smink och kl\xE4der. \xC4ven om du som f\xF6r\xE4lder inte\n            gillar n\xE5got\n            som dina barn vill k\xF6pa \xE4r det viktigt att de f\xE5r best\xE4mma sj\xE4lva \xF6ver sin\n            veckopeng. De m\xE5ste\n            f\xE5 l\xE4ra sig att g\xF6ra val och att g\xF6ra fel val. Det egna valet \xE4r hela id\xE9n och om vi\n            tar bort\n            det hindrar vi ocks\xE5 v\xE5ra barn fr\xE5n att t\xE4nka, l\xE4ra och prova sig fram.\n        </p>\n    ",
	    'training.tab1.person.title': 'Ekonom',
	    'training.tab1.person.about': 'Emma Persson r f.d. privatekonom fr unga p Nordea Bank. Hon har lnge lrt ut kunskap inom pengar och ekonomi fr hela familjen.',
	    'training.tab1.person.tips': 'Emmas tips',
	    'training.tab1.person.tip1': 'Veckopengen kan bli en grund till att prata om drmmar, sparande och mjligheter. Missa inte den.',
