	    'training.tab1.person.bubble': 'I Sverige fr tv av tre barn en vecko- eller mnadspeng av sina frldrar.',
	    'training.tab2.title': 'Digitala hjlpmedel',
	    'training.tab2.header': 'Appar och digitala hjlpmedel r bra fr barnets inlrning.',
	    'training.tab2.content': "\n        <p>\n            <strong>L\xE4rande som inte \xE4r skadligt\n                <br/>\n            </strong>\n            Det finns ingen forskning som visar att det skulle vara skadligt f\xF6r barn, stora som sm\xE5,\n            att anv\xE4nda en surfplatta eller mobil. Att surfplattan eller mobilen ska s\xE4nda ut skadlig\n            str\xE5lning eller g\xF6ra att ett barn p\xE5 n\xE5got s\xE4tt f\xE5r s\xE4mre inl\xE4rning \xE4r bara en myt. Det finns\n            d\xE4remot en risk d\xE5 vi l\xE5ter bli att l\xE4ra v\xE5ra barn om digitala tj\xE4nster och plattfomar, via\n            mobiler och l\xE4splattor, vilket leder till barnen inte l\xE4r sig den teknik som resten av samh\xE4llet\n            har anammat.\n        </p>\n        <p>\n            <strong>Ge utrymme f\xF6r ny form av l\xE4rande\n                <br/>\n            </strong>\n            Som f\xF6r\xE4ldrar \xE4r vi ofta k\xE4nslostyrda och vi m\xE4nniskor har \xF6verlag sv\xE5rt att relatera till\n            nya saker i samh\xE4llet. Att anv\xE4nda digitala verktyg till barnen f\xF6r att underl\xE4tta vardagen ses\n            av m\xE5nga som skamligt. P\xE5 samma s\xE4tt som vi har skepsis mot mobiler och surfplattor har vi\n            bem\xF6tt boken och tv:n n\xE4r de var nya i samh\xE4llet. Men l\xE5t inte dina egna ideal av barndomen\n            styra.\n        </p>\n        <p>\n            <strong>Pengar i mobilen\n                <br/>\n            </strong>\n            Mobilen<strong></strong>\xE4r f\xF6r vuxna det vanligaste s\xE4ttet att h\xE5lla koll p\xE5 pengarna. S\xE5\n            b\xF6r det \xE4ven vara f\xF6r barnen. Idag har de flesta barn en egen mobil och de har en bra f\xF6rst\xE5else\n            f\xF6r hur den anv\xE4nds. D\xE4rf\xF6r \xE4r det bara bra att de ocks\xE5 kan hantera sina pengar i telefonen.\n            Anv\xE4nd appar som \xE4r f\xF6rst\xE5eliga f\xF6r barn f\xF6r att f\xF6rklara pengars v\xE4rde och symboliken med att\n            spara och sl\xF6sa.\n        </p>\n        <p>\n            <strong>Digitala k\xF6p \xE4r ocks\xE5 k\xF6p</strong>\n            <br/>\n            Det \xE4r sv\xE5rare f\xF6r barn att f\xF6rst\xE5 att k\xF6p i mobilen eller p\xE5 n\xE4tet ocks\xE5 kostar pengar.\n            Eftersom de inte f\xE5r n\xE5got i handen som de kan ta eller k\xE4nna p\xE5 \xE4r det viktigt att du som\n            f\xF6r\xE4lder upplyser om att digitala k\xF6p i telefonen ocks\xE5 kostar riktiga pengar. En av tio\n            ungdomar uppger n\xE4mligen att de har k\xF6pt n\xE5got som de f\xF6rst trodde var gratis och varannan har\n            handlat n\xE5got p\xE5 n\xE4tet de senaste tre m\xE5naderna.\n        </p>\n        <p>\n            <strong>L\xE5t det digitala fr\xE4mja kreativiteten</strong>\n            <br/>\n            En annan myt \xE4r den om att mobiler och surfplattor h\xE4mmar kreativiteten hos barn, j\xE4mf\xF6rt med\n            t.ex. Lego. Men om man tittar p\xE5 ett paket Lego, s\xE5 st\xE5r det ju precis vad man ska bygga, j\xE4mf\xF6r\n            det med Minecraft t.ex, d\xE4r finns inga gr\xE4nser till vad man kan skapa och bygga med o\xE4ndligt\n            antal \u201Dlego-bitar\u201D. N\xE4sta generations digitala plattformar kommer utan tvekan att \xF6verv\xE4ga den\n            fysiska v\xE4rldens begr\xE4nsningar vad det g\xE4ller kreativitet.\n        </p>\n    ",
	    'training.tab2.person.title': 'Budgetrdgivare',
	    'training.tab2.person.about': 'Bodil har lnge arbetat med familjens ekonomi och hur man p nya stt och med nya verktyg kan frbttra barnens lrande kring pengar.',
